/**
 * RelationForm Component
 * -------------------------------------
 * Dialog form for creating or editing a relation between two Classes.
 * The user selects source class, target class, type of relation, and cardinality.
 */

import React, { useState, useEffect } from "react";
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  TextField,
  Box,
  MenuItem,
  Grid,
} from "@mui/material";
import { useSelector } from "react-redux";

// Various relation types a user can choose
const relationTypes = [
  "association",
  "aggregation",
  "composition",
  "generalization",
  "dependency",
];

// Example cardinalities
const cardinalities = ["1", "0..1", "1..*", "0..*"];

const RelationForm = ({ open, handleClose, handleSave, initialData }) => {
  // Grab classes from Redux to fill the drop-down lists
  const classes = useSelector((state) => state.editor.classes);

  const [source, setSource] = useState("");
  const [target, setTarget] = useState("");
  const [type, setType] = useState("association");
  const [cardinality, setCardinality] = useState("");

  useEffect(() => {
    if (initialData) {
      setSource(initialData.source);
      setTarget(initialData.target);
      setType(initialData.type);
      setCardinality(initialData.cardinality);
    } else {
      setSource("");
      setTarget("");
      setType("association");
      setCardinality("");
    }
  }, [initialData]);

  /**
   * Save the relation form data, validating user has selected valid classes
   */
  const onSave = () => {
    if (source === "" || target === "") {
      alert("Veuillez sélectionner les classes source et cible.");
      return;
    }

    // Build relation data object
    const relationData = {
      source,
      target,
      type,
      cardinality,
    };

    handleSave(relationData);
  };

  /**
   * Helper to capitalize a string's first letter
   */
  const capitalize = (s) => {
    if (typeof s !== "string") return "";
    return s.charAt(0).toUpperCase() + s.slice(1);
  };

  return (
    <Dialog open={open} onClose={handleClose} maxWidth="sm" fullWidth>
      <DialogTitle>
        {initialData ? "Modifier Relation" : "Ajouter Relation"}
      </DialogTitle>
      <DialogContent>
        <Box sx={{ mt: 1 }}>
          <Grid container spacing={2}>
            {/* Source Class */}
            <Grid item xs={12} sm={6}>
              <TextField
                select
                label="Classe Source"
                value={source}
                onChange={(e) => setSource(e.target.value)}
                required
                fullWidth
              >
                {classes.map((cls) => (
                  <MenuItem key={cls.id} value={cls.id}>
                    {cls.name}
                  </MenuItem>
                ))}
              </TextField>
            </Grid>

            {/* Target Class */}
            <Grid item xs={12} sm={6}>
              <TextField
                select
                label="Classe Cible"
                value={target}
                onChange={(e) => setTarget(e.target.value)}
                required
                fullWidth
              >
                {classes.map((cls) => (
                  <MenuItem key={cls.id} value={cls.id}>
                    {cls.name}
                  </MenuItem>
                ))}
              </TextField>
            </Grid>

            {/* Relation Type */}
            <Grid item xs={12} sm={6}>
              <TextField
                select
                label="Type de Relation"
                value={type}
                onChange={(e) => setType(e.target.value)}
                required
                fullWidth
              >
                {relationTypes.map((relType) => (
                  <MenuItem key={relType} value={relType}>
                    {capitalize(relType)}
                  </MenuItem>
                ))}
              </TextField>
            </Grid>

            {/* Cardinality */}
            <Grid item xs={12} sm={6}>
              <TextField
                select
                label="Cardinalité"
                value={cardinality}
                onChange={(e) => setCardinality(e.target.value)}
                required
                fullWidth
              >
                {cardinalities.map((card) => (
                  <MenuItem key={card} value={card}>
                    {card}
                  </MenuItem>
                ))}
              </TextField>
            </Grid>
          </Grid>
        </Box>
      </DialogContent>

      <DialogActions>
        <Button onClick={handleClose} color="inherit">
          Annuler
        </Button>
        <Button onClick={onSave} variant="contained" color="primary">
          Sauvegarder
        </Button>
      </DialogActions>
    </Dialog>
  );
};

export default RelationForm;
